<p>Одножильный кабель образует замкнутый контур, окончания которого подключаются к электросети. Двужильный нагреватель запитывается только с одной стороны, а на второй устанавливается концевая муфта, используемая в качестве перемычки между жилами.</p>
<p><a href="shop/rezistivnyj-greyushchij-kabel">Резистивный кабель</a> обладает рядом недостатков:</p>
<ol>
<li>Постоянное энергопотребление независимо от температуры окружающей среды. Кабель будет работать до тех пор, пока подключен к сети.</li>
<li>Возможность приобретения только блоками, длину которых можно подобрать лишь с определенным шагом в зависимости от сопротивления. Отрезание «лишних» участков невозможно.</li>
<li>Недопустимость перегиба кабеля – высока вероятность перегрева и расплавления изоляции либо поверхности полиэтиленовой трубы.</li>
</ol>
<h3>Зональный</h3>
<p>В зональных кабелях также невозможно регулирование сопротивления. Плюс этой системы в том, что проводник нагревается не на всю длину, а лишь на отдельных участках. Нарезка на фрагменты допустима: это упрощает монтаж трубопроводов сложной конфигурации.</p>
