<h3>Саморегулирующийся</h3>
<p>Конструкция такого кабеля состоит из двух медных жил с низким сопротивлением, помещенным в полимерную изоляцию.</p>
<p> <img src="data:image/png;base64," width="800" /></p>
<p>Вместе с ними установлена саморегулирующаяся полимерная матрица, смешанная с мелкодисперсным наполнителем-проводником (чаще всего используются частицы графита).</p>
<p>При нагревании происходит расширение полимера, частицы графита удаляются друг от друга, между ними теряется электрический контакт. Повышается сопротивление матрицы, ток, протекающий через нее, падает, а тепловыделение на участке снижается.</p>
<p>При остывании наблюдается обратный процесс: матрица сжимается, токопроводящие частицы «находят» контакт между собой, происходит нагрев участка кабеля.</p>
